import React, { useState } from "react";
import { NavLink } from "react-router-dom";

export default function Header() {
  const [showMenu, setShowMenu] = useState(false);

  function toggleDropDown() {
    setShowMenu(!showMenu);
  }

  return React.createElement(
    "header",
    null,
    React.createElement(
      "div",
      { className: "logo-nav-bar-container" },
      React.createElement("img", {
        src: "/images/hera_logo.png",
        alt: "hera logo",
        className: "logo",
      }),
      React.createElement(
        "nav",
        null,
        React.createElement(
          "div",
          { className: "menu" },
          React.createElement(
            "button",
            {
              type: "button",
              className: "dropDownButton",
              onClick: toggleDropDown,
              "aria-label": "hamburger-menu",
            },
            React.createElement(
              "span",
              { className: "material-symbols-outlined" },
              "menu"
            )
          ),
          React.createElement("div", {
            className: "mask",
            hidden: !showMenu,
            onClick: toggleDropDown,
          }),
          React.createElement(
            "div",
            { className: "dropDown", hidden: !showMenu },
            React.createElement(
              "ul",
              { className: "nav-links" },
              React.createElement(
                "li",
                null,
                React.createElement(NavLink, { to: "/", exact: true }, "Home")
              ),
              React.createElement(
                "li",
                null,
                React.createElement(NavLink, { to: "/about-us" }, "About Us")
              ),
              React.createElement(
                "li",
                null,
                React.createElement(
                  NavLink,
                  { to: "/wellness-history" },
                  "Wellness History"
                )
              ),
              React.createElement(
                "li",
                null,
                React.createElement(NavLink, { to: "/resources" }, "Resources")
              )
            )
          )
        )
      ),
      React.createElement(
        "div",
        { className: "profile-icon" },
        React.createElement(
          NavLink,
          { to: "/profile" },
          React.createElement("img", {
            src: "/images/profile_icon.png",
            alt: "Profile",
          })
        )
      )
    )
  );
}
